import Vue from "vue";
import VueRouter from "vue-router";

import Home from "../views/Home/Home.vue";

Vue.use(VueRouter);

let router = new VueRouter({
    routes: [
        {
        path: "/",
        name: "Home",
        component: Home,
        meta: {
            guest: true,
          },
        }, 
    ]

})

export default router;
